import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import { Typography } from "@material-ui/core";
import Logo from "../images/ostello_logo.png";



// CSS Codes
const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
  excelName:{
    fontSize:"43px",
    fontFamily:"Calibri",
    FontWeight:"bolder",
    color: "#6A6A6A",
    marginLeft:"8rem",
    marginTop:"1rem"
  },
  logo_img:{
    marginLeft: "8rem",
    width: "126px",
    bottom: "486px",
    marginTop: "8rem",
    cursor: "pointer",
    height:"56px"
  }
}));



export default function FullWidthGrid() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={8}>
          <Typography >
            <img className={classes.logo_img} src={Logo} alt="Logo"></img>
          </Typography>
          <Typography className={classes.excelName}>
          Excellence
          </Typography>
          <Typography>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Condimentum magna massa vitae amet purus. 
          Consequat tincidunt in blandit mattis nulla eu, turpis ut. Sem in diam arcu et ac vel sed. Sed nunc sit mauris id lorem imperdiet tellus mattis
          </Typography>
        </Grid>
        <Grid item xs={4}>
        </Grid>
      </Grid>
    </div>
  );
}
